import React from 'react'
import './Footer.css'
function Footer() {
  return (
    <>

<footer class="footer">
  <div class="footer-left col-md-4 col-sm-6">
    <p class="about">
      <span> About Us</span> welcomes you to the world of Live Aquatic Plants, Fresh Water Fishes, Aquarium Accessories. We offer the high quality Aquatic Plants and Fishes that grows with in the Venice of the east, Alappuzha. We have more than 600+ farm products. Our Aquatic Plants are harvested in the same day we ship. Everything is Fresh from our Farm !.
    </p>
    <div class="icons">
      <a href="#"><i class="fa fa-facebook"></i></a>
      <a href="#"><i class="fa fa-twitter"></i></a>
      <a href="#"><i class="fa fa-linkedin"></i></a>
      <a href="#"><i class="fa fa-google-plus"></i></a>
      <a href="#"><i class="fa fa-instagram"></i></a>
    </div>
  </div>
  <div class="footer-center col-md-4 col-sm-6">
    <div>
      <i class="fa fa-map-marker"></i>
      <p><span> Kozhikode</span> Kerala, India</p>
    </div>
    <div>
      <i class="fa fa-phone"></i>
      <p> (+91) 0495 395798</p>
    </div>
    <div>
      <i class="fa fa-envelope"></i>
      <p><a href="#"> Oceanic@g.com</a></p>
    </div>
  </div>
  <div class="footer-right col-md-4 col-sm-6">
    <h2> Oceanic<span> logo</span></h2>
    <p class="menu">
      <a href="#"> Home</a> 
      <a href="#"> About</a> 
      <a href="#"> Contact Us</a>
    </p>
    <p class="name"> Oceanic &copy; 2023</p>
  </div>
</footer>



   </>
  )
}

export default Footer




